这里就是她们说的“文明城市”，广东省佛山市，顺德区容桂街道细滘居委会，官田村福田路，我家房屋就在这里，  我回家的道路经常被恶意阻挡。
       图片中的工程车，停放的时间是中午12点，我拍摄的时候在工程车停放的地方停留了大概40分钟，车上一直没人，12点是下班时间了，她们故意把车停在路中间阻挡我回家。(当时我报了警)
        石墩封路，已经是2024年春节前开始的了，当时我报了警，治安员电话联系了居委会人员后对我说：“放石墩是为了防止春节期间有人乱到垃圾，节后就会移走石墩”，但石墩至今阻挡道路。
        铁皮围蔽道路更恶劣，围蔽了整条道路的三份二，在我房屋的地方更是故意围剩只能过一部车的位置。
        这是何等歹毒的人才能干得出来的事?居然发生在法治城市与文明城市，佛山市！

